import { Header, Slider } from "../../components";
import { Section } from "../../components";
import { useSelector } from "react-redux";


const Home = () => {
  const { daily , chill } = useSelector((state) => state.app);

  return (
    <div className="overflow-y-auto flex  ">
      <Slider />
      <Section data = {chill}/>
      <Section data = {daily}/>
    </div>
  );
};

export default Home;
